import { Title, Button } from "@tremor/react";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

const Register = ({ access_token }) => {
  async function handleSubmit(event) {
    event.preventDefault();
    const id = toast.loading("Please wait...", {
      closeButton: true,
    });
    const UserName = document.getElementById("UserName").value;
    const Name = document.getElementById("Name").value;
    const Email = document.getElementById("Email").value;
    const PhoneNumber = document.getElementById("PhoneNumber").value;
    const TargetRole = document.getElementById("TargetRole").value;
    const Password = document.getElementById("Password").value;
    const ConfirmPassword = document.getElementById("ConfirmPassword").value;
    const Degree = document.getElementById("Degree").value;

    const data = {
      UserName: UserName,
      Name: Name,
      Email: Email,
      PhoneNumber: PhoneNumber,
      TargetRole: TargetRole,
      Password: Password,
      ConfirmPassword: ConfirmPassword,
      Degree: Degree,
    };

    const url = "/api/register";

    const options = {
      method: "POST",
      body: new URLSearchParams(data),
    };

    const response = await fetch(url, options);
    if (response.status == 400) {
      toast.update(id, {
        render: "Somthing went wrong",
        type: "error",
        isLoading: false,
        closeButton: true,
      });
    } else {
      toast.update(id, {
        render: "Registered successed",
        type: "success",
        isLoading: false,
        closeButton: true,
      });
    }
  }

  return (
    <div className="flex justify-center my-5 px-5">
      <ToastContainer />
      <div className="bg-white rounded-lg">
        <Title className="mb-5">Register</Title>
        <form onSubmit={handleSubmit}>
          <div className="flex mb-4">
            <div className="flex flex-col mr-5">
              <label className="block text-gray-700 mb-2" htmlFor="Name">
                Name
              </label>
              <input
                className="border rounded-lg px-3 py-2 w-full"
                type="text"
                id="Name"
              />
            </div>
            <div className="flex flex-col">
              <label className="block text-gray-700 mb-2" htmlFor="UserName">
                UserName
              </label>
              <input
                className="border rounded-lg px-3 py-2 w-full"
                type="text"
                id="UserName"
              />
            </div>
          </div>
          <div className="mb-6">
            <label className="block text-gray-700 mb-2" htmlFor="Email">
              Email
            </label>
            <input
              className="border rounded-lg px-3 py-2 w-full"
              type="email"
              id="Email"
            />
          </div>

          <div className="mb-6">
            <label className="block text-gray-700 mb-2" htmlFor="PhoneNumber">
              PhoneNumber
            </label>
            <input
              className="border rounded-lg px-3 py-2 w-full"
              type="number"
              id="PhoneNumber"
            />
          </div>
          <div className="mb-6">
            <label className="block text-gray-700 mb-2" htmlFor="TargetRole">
              TargetRole
            </label>
            <select
              id="TargetRole"
              className="border rounded-lg px-3 py-2 w-full"
            >
              <option value="Admin">Admin</option>
              <option value="Professor">Professor</option>
              <option value="Worker">Worker</option>
            </select>
          </div>
          <div className="flex mb-4">
            <div className="flex flex-col mr-5">
              <label className="block text-gray-700 mb-2" htmlFor="Password">
                Password
              </label>
              <input
                className="border rounded-lg px-3 py-2 w-full"
                type="password"
                id="Password"
              />
            </div>
            <div className="flex flex-col">
              <label
                className="block text-gray-700 mb-2"
                htmlFor="ConfirmPassword"
              >
                ConfirmPassword
              </label>
              <input
                className="border rounded-lg px-3 py-2 w-full"
                type="password"
                id="ConfirmPassword"
              />
            </div>
          </div>
          <div className="mb-6">
            <label className="block text-gray-700 mb-2" htmlFor="Degree">
              Degree
            </label>
            <input
              className="border rounded-lg px-3 py-2 w-full"
              type="text"
              id="Degree"
            />
          </div>
          <Button type="submit" color="black" size="md">
            Register
          </Button>
        </form>
      </div>
    </div>
  );
};

export async function getServerSideProps({ req }) {
  const access_token = req.cookies.access_token
    ? req.cookies.access_token
    : null;

  if (!access_token) {
    return {
      redirect: {
        destination: "/login",
        permanent: false,
      },
    };
  }
  return {
    props: { access_token },
  };
}

export default Register;
